import React from 'react';

const Movie = (props) => {
    return (
        <div>

            <table>
            <tr><h1>{props.name}</h1></tr>
            <tr><h2>Price: {props.price}</h2></tr>
            </table>
            <h1>{props.name}</h1>

            <p>{props.desc}</p>
            <hr></hr>

        </div>
    );


};

export default Movie;
